			["actions"] = {
				["start"] = {
					["message"] = "",
					["custom"] = "aura_env.announcePositions()",
					["do_sound"] = false,
					["message_type"] = "PARTY",
					["sound"] = "Interface\\Addons\\WeakAuras\\PowerAurasMedia\\Sounds\\aggro.ogg",
					["do_message"] = false,
					["do_custom"] = true,
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "-- Ranged class specializations\nlocal rangedSpecs = {\n    102, 105, 253, 254, 62, 63, 64, 256,\n    257, 258, 262, 264, 265, 266, 267\n}\n\n-- Ranged class guesses (if API returns spec 0)\nlocal rangedClasses = {\n    3, 5, 7, 8, 9, 11\n}\n\n-- Mythic difficulty IDs\nlocal mythicDifficulties = {\n    8, 23\n}\n\n-- Heroic difficulty IDs\nlocal heroicDifficulties = {\n    1, 2\n}\n\n-- Marker configuration\nlocal markers = {\n    [1] = { markerID = aura_env.config[\"markers\"][\"markerTopRight\"], str = \"top right\" },\n    [2] = { markerID = aura_env.config[\"markers\"][\"markerTopLeft\"], str = \"top left\" },\n    [3] = { markerID = aura_env.config[\"markers\"][\"markerBackRight\"], str = \"back right\" },\n    [4] = { markerID = aura_env.config[\"markers\"][\"markerBackLeft\"], str = \"back left\" }\n}\n\nlocal function debugMsg(msg)\n    DEFAULT_CHAT_FRAME:AddMessage(msg)\nend\n\nlocal function isInTable(t, value)\n    for _, v in pairs(t) do\n        if v == value then\n            return true\n        end\n    end\n    \n    return false\nend\n\nlocal function getFirstDpsMarkID()\n    local tankMarker = aura_env.config[\"markers\"][\"tankMarker\"]\n    if tankMarker == 1 then\n        return 2\n    elseif tankMarker == 2 then\n        return 1\n    end\nend\n\nlocal function getUnitSpecID(unitID)\n    if unitID == \"player\" then\n        return GetSpecializationInfo(GetSpecialization())\n    else\n        return GetInspectSpecialization(unitID)\n    end\nend\n\nlocal function getUnitData(unitID)\n    local _, m_classID = UnitClassBase(unitID)\n    \n    return {\n        unitID = unitID,\n        name = UnitName(unitID),\n        role = UnitGroupRolesAssigned(unitID),\n        classID = m_classID,\n        specID = getUnitSpecID(unitID)\n    }\nend\n\nlocal function getPartyData()\n    local data = { getUnitData(\"player\") }\n    local psize = GetNumGroupMembers()\n    \n    if psize > 0 then\n        for i = 1, psize - 1 do\n            data[#data + 1] = getUnitData(\"party\" .. i)\n        end\n    end\n    \n    return data\nend\n\nlocal function initUnitPositionData(unitData)\n    return {\n        marker = 1,\n        unitData = unitData\n    }\nend\n\nlocal function initPositionData(partyData)\n    local posData = {}\n    \n    for _, unitData in pairs(partyData) do\n        posData[#posData + 1] = initUnitPositionData(unitData)\n    end\n    \n    return posData\nend\n\nlocal function isUnitTankOrHeal(unitData)\n    return unitData.role == \"HEALER\" or unitData.role == \"TANK\"\nend\n\nlocal function isUnitMelee(unitData)\n    if unitData.specID == 0 then\n        if isInTable(rangedClasses, unitData.classID) then\n            return false\n        else\n            return true\n        end\n    else\n        if isInTable(rangedSpecs, unitData.specID) then\n            return false\n        else\n            return true\n        end\n    end\nend\n\nlocal function sortPositionsHeroic(posData)\n    local sortedPos = posData\n    local tankMarker = aura_env.config[\"markers\"][\"tankMarker\"]\n    \n    local mark2 = getFirstDpsMarkID()\n    \n    for k, v in pairs(posData) do\n        if isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = tankMarker\n        end\n    end\n    \n    for k, v in pairs(posData) do\n        if not isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = mark2\n        end\n    end\n    \n    for k, v in pairs(posData) do\n        if not isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = tankMarker\n            break\n        end\n    end\n    \n    return sortedPos\nend\n\nlocal function sortPositionsMythic(posData)\n    local sortedPos = posData\n    local tankMarker = aura_env.config[\"markers\"][\"tankMarker\"]\n    local dpsMarks = {\n        [1] = getFirstDpsMarkID(),\n        [2] = 3,\n        [3] = 4\n    }\n    \n    local markID = 1\n    \n    for k, v in pairs(posData) do\n        if isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = tankMarker\n        end\n    end\n    \n    for k, v in pairs(posData) do\n        if isUnitMelee(v.unitData) and not isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = dpsMarks[markID]\n            \n            if #dpsMarks >= markID + 1 then\n                markID = markID + 1\n            end\n        end\n    end\n    \n    for k, v in pairs(posData) do\n        if not isUnitMelee(v.unitData) and not isUnitTankOrHeal(v.unitData) then\n            sortedPos[k].marker = dpsMarks[markID]\n            \n            if #dpsMarks >= markID + 1 then\n                markID = markID + 1\n            end\n        end\n    end\n    \n    return sortedPos\nend\n\nlocal function sortPositions(posData, difficulty)\n    if isInTable(mythicDifficulties, difficulty) then\n        return sortPositionsMythic(posData)\n    elseif isInTable(heroicDifficulties, difficulty) then\n        return sortPositionsHeroic(posData)\n    end\n    \n    return posData\nend\n\nlocal function announceUnitPosition(unitPos, difficulty)\n    local chatMsg\n    local healStr = \"\"\n    \n    if unitPos.unitData.role == \"HEALER\" then\n        healStr = \" with tank\"\n    end\n    \n    if aura_env.config[\"noMarkers\"] then\n        chatMsg = string.format(\"%s please go to %s%s\",\n            unitPos.unitData.name,\n            markers[unitPos.marker].str,\n            healStr\n        )\n    else\n        chatMsg = string.format(\"%s please go to {rt%d} (%s%s)\",\n            unitPos.unitData.name,\n            markers[unitPos.marker].markerID,\n            markers[unitPos.marker].str,\n            healStr\n        )\n    end\n    \n    SendChatMessage(chatMsg, \"party\")\nend\n\nlocal function announce(posData)\n    local sortedData = posData\n    table.sort(sortedData, function(a, b) return a.marker < b.marker end)\n    \n    for _, v in pairs(sortedData) do\n        if not aura_env.config[\"noMarkers\"] then\n            SetRaidTarget(v.unitData.unitID, markers[v.marker].markerID)\n        end\n        \n        if aura_env.config[\"sendMsg\"] then\n            announceUnitPosition(v)\n        end\n    end\nend\n\naura_env.announcePositions = function()\n    local instanceInfo = {GetInstanceInfo()}\n    local difficulty = instanceInfo[3]\n    local instanceID = instanceInfo[8]\n    \n    if (isInTable(mythicDifficulties, difficulty)\n        or isInTable(heroicDifficulties, difficulty))\n    and instanceID == 2291 then\n        \n        local partyData = getPartyData()\n        local posData = initPositionData(partyData)\n        local sortedPos = sortPositions(posData, difficulty)\n        \n        announce(sortedPos)\n    else\n        debugMsg(\"Need to be in a Mythic, Keystone, Heroic or Normal difficulty instance of De Other Side\")\n    end\nend",
					["do_custom"] = true,
